class TongHuaShunSpider(scrapy.Spider):
    name = "tonghuashun"
    # base_url = "http://search.10jqka.com.cn/search?tid=info&qs=box_ths&w={}"
    data_path = os.getcwd() + "/WaiBaoSpider/data/%s/" % name
    if os.path.exists(data_path):
        pass
    else:
        os.mkdir(data_path)
    dump_list = CSVDumper(data_path + "%s_list.csv" % name)
    dump_detail = CSVDumper(data_path + "%s_detail.csv" % name)
    # HTTPERROR_ALLOWED_CODES = [301]
    custom_settings = {
        'DOWNLOAD_DELAY': 1,
    }
    headers = {
        "User-Agent": "Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/71.0.3578.98 Safari/537.36",
        "Referer": "http://search.10jqka.com.cn/search?tid=info&qs=box_ths&w=20180129%E6%97%A5%E8%A1%8C%E4%B8%9A%E8%B4%9F%E9%9D%A2%E6%96%B0%E9%97%BB%E4%B8%80%E8%A7%88",
        "Cookie": "cid=bac9a4f8bdaeeeaf93998b6c1308d1801548732474; ComputerID=bac9a4f8bdaeeeaf93998b6c1308d1801548732474; Hm_lvt_78c58f01938e4d85eaf619eae71b4ed1=1548731697,1548731841,1548738485; PHPSESSID=d6076401d8ffa1afab543dfed54018dd; iwencaisearchquery=20180810%E6%97%A5%E8%A1%8C%E4%B8%9A%E8%B4%9F%E9%9D%A2%E6%96%B0%E9%97%BB%E4%B8%80%E8%A7%88; log=; Hm_lpvt_78c58f01938e4d85eaf619eae71b4ed1=1548739749; v=AsCTtEr0iMwr-3TIDWP-2QWwkUWRSaQ2Riz4FzpSj_pu0W5z4ll0o5Y9yYOJ",
    }

    def start_requests(self):
        for i in u_list:
            url = i
            yield Request(url, callback=self.parse_list, headers=self.headers)

    def parse_list(self, response):
        body = unicode_body(response)
        html = etree.HTML(body)
        lines = html.xpath("//div[@class='main-text atc-content']/table/tr")[1:]
        p_time = html.xpath("//span[@id='pubtime_baidu']/text()")[0].strip()
        p_time = dateformatting.parse(p_time).strftime('%Y-%m-%d %H:%M:%S')
        print(len(lines))
        for info in lines:
            item = {}
            item["title"] = info.xpath("./td[1]/text()")[0].strip()
            item["source"] = info.xpath("./td[2]/text()")[0].strip()
            item["time"] = p_time
            self.dump_list.process_item(item)
            print("##")
        print("---------------")
